rex_cmd = r"[a-zA-Z]\s?(-?\d+\.?\d*[, ]-?\d+\.?\d*\s*)*"

Point2 = Union[np.ndarray, Sequence[float]]


def main():
    cmds = parse_path(source)
    segments = discretize_path(cmds)

    csv = []
    for seg in segments:
        pts = np.array(seg.pts)
        if not seg.drawing:
            csv.append(f"{','.join(str(w) for w in pts[-1].round(2))},false\n")
            continue

        for pt in pts[:-1]:
            csv.append(f"{','.join(str(w) for w in pt.round(2))},true\n")
        plt.plot(pts[:, 0], pts[:, 1], "-x", c="gray")

    plt.axis("scaled")
    plt.gca().invert_yaxis()
    plt.show()

    with open("out.csv", "w") as fh:
        fh.writelines(csv)


@dataclass
class PathCommand:
    cmd: str
    coords: Sequence[Tuple[float, float]]

    def __eq__(self, other):
        cmd_same = self.cmd == other.cmd
        coords_same = np.allclose(self.coords, other.coords)
        return cmd_same and coords_same


@dataclass
class Segment:
    pts: Sequence[Point2]
    drawing: bool = True

    def bb(self):
        mins = np.min(self.pts, axis=0)
        maxs = np.max(self.pts, axis=0)
        return mins, maxs

    def median(self):
        return np.median(self.pts, axis=0)


class BinaryBVH:
    def __init__(self, segments: Collection[Segment]):
        self._segments = segments
        self._tree = self.build_tree(self._segments)

    def get_intersections(self, ray_start, ray_dir, debug=False):
        pass

    @staticmethod
    def build_tree(segments: Collection[Segment], split_dim=0):
        for seg in segments:
            assert isinstance(seg, Segment)
        nodes = []

        mini, maxi = get_segments_bb(segments)
        dims = maxi - mini
        center = mini + dims / 2
        radius = np.linalg.norm(dims) / 2

        segment_locs = np.array([seg.median()[split_dim] for seg in segments])
        where_left = segment_locs < center[split_dim]
        where_righ = segment_locs >= center[split_dim]

        next_split = 1 if split_dim == 0 else 1
        segments_left = [seg for i, seg in enumerate(segments) if where_left[i]]
        segments_righ = [seg for i, seg in enumerate(segments) if where_righ[i]]
        print("segs left", segments_left)
        print("segs righ", segments_righ)

        if len(segments_left) > 1:
            print("going deeper left")
            subtree_left = BinaryBVH.build_tree(segments_left, split_dim=next_split)
        else:
            subtree_left = segments_left[0]

        if len(segments_righ) > 1:
            print("going deeper right")
            subtree_righ = BinaryBVH.build_tree(segments_righ, split_dim=next_split)
        else:
            subtree_righ = segments_righ[0]

        return (center, radius, subtree_left, subtree_righ)


def bezier_quad(start, end, control_pt1, arc_len=True):
    p0, p1, p2 = start, control_pt1, end
    assert len(p0) == len(p1) == len(p2) == 2

    def _spline_time(t):
        return p1 + (1 - t) ** 2 * (p0 - p1) + t**2 * (p2 - p1)

    def _spline_dt(t):
        return np.reshape(2 * (1 - t) * (p1 - p0) + 2 * t * (p2 - p1), (-1, 1))

    if not arc_len:
        return 1, _spline_time

    # sanity check that wikipedia gradients are correct
    # err = check_grad(_spline_time, _spline_dt, 0)
    # assert err < 1e-5, f"err={err:.2f}"
    # err = check_grad(_spline_time, _spline_dt, 0.5)
    # assert err < 1e-5, f"err={err:.2f}"
    # err = check_grad(_spline_time, _spline_dt, 1)
    # assert err < 1e-5, f"err={err:.2f}"

    # For arc-length parameterization, we build a reverse lookup table to
    # interpolate from, to get t(s)
    ts = []
    ss = []
    for t in np.linspace(0, 1, 100):
        s, err = quad(lambda x: np.linalg.norm(_spline_dt(x)), 0, t)
        assert err < 1e-5, f"integration got large error {err}"
        ss.append(s)
        ts.append(t)

    def _spline_arc(s):
        t = np.interp(s, ss, ts)
        return _spline_time(t)

    arc_length = ss[-1]
    return arc_length, _spline_arc


def bezier_cubic(start, end, control_pt1, control_pt2, arc_len=True):
    p0, p1, p2, p3 = start, control_pt1, control_pt2, end
    assert len(p0) == len(p1) == len(p2) == len(p3) == 2

    def _spline_time(t):
        return (
            (1 - t) ** 3 * p0
            + 3 * (1 - t) ** 2 * t * p1
            + 3 * (1 - t) * t**2 * p2
            + t**3 * p3
        )

    def _spline_dt(t):
        return np.reshape(
            3 * (1 - t) ** 2 * (p1 - p0)
            + 6 * (1 - t) * t * (p2 - p1)
            + 3 * t**2 * (p3 - p2),
            (-1, 1),
        )

    if not arc_len:
        return 1, _spline_time

    # sanity check that wikipedia gradients are correct
    # err = check_grad(_spline_time, _spline_dt, 0)
    # assert err < 1e-5, f"err={err:.2f}"
    # err = check_grad(_spline_time, _spline_dt, 0.5)
    # assert err < 1e-5, f"err={err:.2f}"
    # err = check_grad(_spline_time, _spline_dt, 1)
    # assert err < 1e-5, f"err={err:.2f}"

    # For arc-length parameterization, we build a reverse lookup table to
    # interpolate from, to get t(s)
    ts = []
    ss = []
    for t in np.linspace(0, 1, 100):
        s, err = quad(lambda x: np.linalg.norm(_spline_dt(x)), 0, t)
        assert err < 1e-5, f"integration got large error {err}"
        ss.append(s)
        ts.append(t)

    def _spline_arc(s):
        t = np.interp(s, ss, ts)
        return _spline_time(t)

    arc_length = ss[-1]
    return arc_length, _spline_arc


def discretize_path(cmds: Sequence[PathCommand], spline_step=None):
    cursor = [0.0, 0.0]
    segments = []
    start_subpath = cursor

    for cmd in cmds:
        print("Executing command", cmd)

        if cmd.cmd == "m":
            # relative move
            cursor_old = cursor.copy()
            cursor[0] += cmd.coords[0][0]
            cursor[1] += cmd.coords[0][1]
            segments.append(Segment([cursor_old, cursor], drawing=False))
            start_subpath = cursor.copy()

            pts = [start_subpath]
            for coord in cmd.coords[1:]:
                cursor[0] += coord[0]
                cursor[1] += coord[1]
                pts.append(cursor.copy())

            # subsequent move commands behave like line commands
            if pts:
                segments.append(Segment(pts))
        elif cmd.cmd == "M":
            # absolute move
            cursor_old = cursor.copy()
            cursor[0] = cmd.coords[0][0]
            cursor[1] = cmd.coords[0][1]
            segments.append(Segment([cursor_old, cursor], drawing=False))
            start_subpath = cursor.copy()

            pts = [start_subpath]
            for coord in cmd.coords[1:]:
                cursor[0] = coord[0]
                cursor[1] = coord[1]
                pts.append(cursor.copy())

            # subsequent move commands behave like line commands
            if pts:
                segments.append(Segment(pts))
        elif cmd.cmd in ["z", "Z"]:
            segments.append(Segment([cursor.copy(), start_subpath.copy()]))
            cursor = start_subpath.copy()
        elif cmd.cmd in ["c", "C"]:
            assert (
                len(cmd.coords) % 3 == 0
            ), "Expected cubic path to have multiple of 3 coordinates!"

            is_relative = cmd.cmd.islower()
            for i in range(0, len(cmd.coords) - 2, 3):
                prevpt = np.array(cursor) if is_relative else np.array([0, 0])
                tipa = prevpt + cmd.coords[i]
                tipb = prevpt + cmd.coords[i + 1]
                nextpt = prevpt + cmd.coords[i + 2]

                alen, b = bezier_cubic(np.array(cursor), nextpt, tipa, tipb)
                if not spline_step:
                    spline_step = alen / 20

                asses = np.linspace(0, alen, int(alen // spline_step))
                if not len(asses):
                    raise RuntimeError("no asses")
                    # how does this happen?
                    continue
                pts = np.array([b(s) for s in asses])
                segments.append(Segment(pts))
                cursor = nextpt
        elif cmd.cmd in ["q", "Q"]:
            assert (
                len(cmd.coords) % 2 == 0
            ), "Expected cubic path to have multiple of 2 coordinates!"

            is_relative = cmd.cmd.islower()
            for i in range(0, len(cmd.coords) - 1, 2):
                prevpt = np.array(cursor) if is_relative else np.array([0, 0])
                tipa = prevpt + cmd.coords[i]
                nextpt = prevpt + cmd.coords[i + 1]

                alen, b = bezier_quad(np.array(cursor), nextpt, tipa)
                if not spline_step:
                    spline_step = alen / 20

                asses = np.linspace(0, alen, int(alen // spline_step))
                if not len(asses):
                    raise RuntimeError("no asses")
                    # how does this happen?
                    continue
                pts = np.array([b(s) for s in asses])
                segments.append(Segment(pts))
                cursor = nextpt
        elif cmd.cmd == "l":
            # relative polyline
            xs = [cursor[0]]
            ys = [cursor[1]]
            for coord in cmd.coords:
                cursor[0] += coord[0]
                cursor[1] += coord[1]
                xs.append(cursor[0])
                ys.append(cursor[1])
            # plt.plot(xs, ys)
            segments.append(Segment(list(zip(xs, ys))))
        elif cmd.cmd == "L":
            # absolute polyline
            xs = [cursor[0]]
            ys = [cursor[1]]
            for coord in cmd.coords:
                cursor[0] = coord[0]
                cursor[1] = coord[1]
                xs.append(cursor[0])
                ys.append(cursor[1])
            # plt.plot(xs, ys)
            segments.append(Segment(list(zip(xs, ys))))
        else:
            raise NotImplementedError(f"Unknown command {cmd.cmd}")

    return segments


def parse_path(source):
    cmds: List[PathCommand] = []
    for match in re.finditer(rex_cmd, source):
        thing = match.group(0).replace(",", " ")
        cmd = thing[0]
        coords = thing[1:].strip().split()
        assert (
            len(coords) % 2 == 0
        ), f"Need even number of coords, but didn't get ({coords}) from ({thing})"

        coords = np.array([float(c) for c in coords]).reshape(-1, 2)
        print("coords", coords)
        cmds.append(PathCommand(cmd=cmd, coords=coords))
    return cmds


def get_segments_bb(segments: Collection[Segment]):
    mins, maxs = zip(*[seg.bb() for seg in segments if seg.drawing])
    mini = np.min(mins, axis=0)
    maxi = np.max(maxs, axis=0)
    return mini, maxi


def hatch_path(
    segments: Collection[Segment],
    hatch_start_xy=None,
    hatch_dir=None,
    hatch_dist=None,
):
    mini, maxi = get_segments_bb(segments)
    dims = maxi - mini

    hatch_dir = np.array(hatch_dir, dtype=float)
    hatch_dir /= np.linalg.norm(hatch_dir)
    if np.dot(hatch_dir, [1, 1]) < 0:
        hatch_dir *= -1

    dx, dy = hatch_dir
    hatch_normal = np.array([dy, -dx])
    if np.dot(hatch_normal, [1, 1]) < 0:
        hatch_normal *= -1

    diag = np.dot(dims, hatch_normal)
    nsteps = round(diag / hatch_dist)

    for k in range(nsteps):
        anchor = mini + k * hatch_dist * hatch_normal
        other = anchor + np.dot(dims, hatch_dir) * hatch_dir
        segments.append(Segment([anchor, other]))

    return segments


